import React, {Component, useState, useEffect} from 'react'



function PostList() {
    const [articles, setArticles] = useState([]);

    useEffect(()=>{
        document.title = `you clicked ${articles}`;
    }, [articles])
    return (
        <div>
            <p>Howdy</p>
            <p> You clicked {articles}</p>
            <button onClick={()=> setArticles()}>Click me!</button>
        </div>
    )
}

export default PostList
